  false,\n\t\"url\": null,\n\t\"notes\": \"This data set was distributed by NSIDC
  until October, 2003, when it was withdrawn from distribution because it duplicates
  the NOAA National Climatic Data Center (NCDC) data set TD-9816 'Canadian Monthly
  Precipitation' (Groisman, P.Y. 1998. National Climatic Data Center Data Documentation
  for TD-9816, Canadian Monthly Precipitation. National Climatic Data Center 151 Patton
  Ave., Asheville, NC. 21 pp.). TD-9816 contains monthly rainfall, snowfall and precipitation
  (the sum of rainfall and snowfall) values from 6,692 stations in Canada. NCDC investigator
  Pavel Groisman obtained the original data from the Canadian Atmospheric Environment
  Service (AES) in the early 1990s and adjusted the measurements to account for inconsistencies
  and changes in instrumentation over the period of record. TD-9816 contains both
  the original and adjusted data. Related data are the Historical Adjusted Climate
  Database for Canada, Version December 2002, and Rehabilitated Precipitation and
  Homogenized Temperature Data Sets provided by the Climate Monitoring and Data Interpretation
  Division's Climate Research Branch, Meteorological Service of Canada. Monthly Rehabilitated
  Precipitation and Homogenized Temperature Data Sets (updated annually) includes
  an alternative version of this data set using different correction methods. It is
  distributed by the Meteorological Service of Canada, who also provides a Microsoft
  Word document that compares the two different data correction methods.\",\n\t\"license_title\":
